class Navbar extends Component {
    render() {
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">
                    <div className="menu-icon">

                    </div>
                    <ul>
                        <li><a className={items.cName}href="#"></a></li>
                    </ul>
                </h1>
            </nav>
        )
    }
}
